// GraphQL Mutations
const createItem = `
  mutation CreateItem($input: CreateItemInput!) {
    createItem(input: $input) {
      id
      type
      name
      price
      image
      ingredients
    }
  }
`;

const createChef = `
  mutation CreateChef($input: CreateChefInput!) {
    createChef(input: $input) {
      id
      name
      price
      image
      rating
      dishes
    }
  }
`;

// Query to check existing items
const listItems = `
  query ListItems {
    listItems {
      items {
        id
        type
        name
        price
        image
        ingredients
      }
    }
  }
`;

interface ListItemsResponse {
  listItems: {
    items: Item[];
  };
}

interface CreateItemInput {
  type: string;
  name: string;
  price: string;
  image: string;
  ingredients: string[];
}

interface CreateChefInput {
  name: string;
  price: string;
  image: string;
  rating: number;
  dishes: string[];
}

// Function to seed data
async function seedData() {
  try {
    // Step 1: Check if items already exist
    const existingItemsResponse = await API.graphql(graphqlOperation(listItems)) as { data: ListItemsResponse };
    const existingItems = existingItemsResponse.data.listItems.items;

    if (existingItems.length > 0) {
      console.log('Data already exists in the database. Skipping seeding.');
      return;
    }

    // Step 2: Seed Items
    const createdItems: Item[] = [];
    for (const item of staticItems) {
      const input: CreateItemInput = {
        type: item.type,
        name: item.name,
        price: item.price,
        image: item.image,
        ingredients: item.ingredients,
      };
      const response = await API.graphql(graphqlOperation(createItem, { input })) as { data: { createItem: Item } };
      createdItems.push(response.data.createItem);
      console.log(`Created item: ${item.name} with ID: ${response.data.createItem.id}`);
    }

    // Step 3: Seed Chefs with Item IDs
    const pizzaId = createdItems.find(item => item.name === 'Pizza')?.id;
    const burgerId = createdItems.find(item => item.name === 'Burger')?.id;

    const chefsWithDishes = [
      { ...staticChefs[0], dishes: pizzaId ? [pizzaId] : [] },
      { ...staticChefs[1], dishes: burgerId ? [burgerId] : [] },
    ];

    for (const chef of chefsWithDishes) {
      const input: CreateChefInput = {
        name: chef.name,
        price: chef.price,
        image: chef.image,
        rating: chef.rating,
        dishes: chef.dishes,
      };
      const response = await API.graphql(graphqlOperation(createChef, { input })) as { data: { createChef: Chef } };
      console.log(`Created chef: ${chef.name} with ID: ${response.data.createChef.id}`);
    }

    console.log('Data seeding completed successfully!');
  } catch (error) {
    console.error('Error seeding data:', error);
  }
}

// Run the seeding function
seedData();